from sys import set_int_max_str_digits
import time
set_int_max_str_digits(1_000_000)
money, countPeople, days = map(int, input().split())
result = money
start = time.time()
for i in range(days):
    for j in range(10):
        new_money = result*10 + j
        if new_money%countPeople==0:
            result = new_money
            break
    if result == money:
        result = -1
        break
    elif j == 0:
        result  = str(result) + '0'*(days - (i+1))
        break
print(int(result))
print(time.time() - start)
